import React from 'react'
import { Card, CardColumns } from 'react-bootstrap';

import Review from './Review';

export default function Footer({ id }) {
    return (
        <Card>
            <Card.Footer>
                <CardColumns>
                    <Card.Text>0606060606</Card.Text>
                    <Card.Text>contact@jaipasdevoiture.com</Card.Text>
                </CardColumns>
            </Card.Footer>
        </Card>
    )
}
